import styles from "./Registration.module.scss";


import React, {useState} from 'react';

import {Link} from 'react-router-dom'; 
import axios from "axios";

function Registration() {
  const [data, setData] = useState({});
  const [lastName, setLastName] = React.useState(``);
  const [name, setName] = React.useState(``);
  const [patronymic, setPatronymic] = React.useState(``);
  const [localityShipping, setEmail] = React.useState(``);
  const [addressShipping, setAddressShipping] = React.useState(``);
  const [postcode, setPostcode] = React.useState(``);
  const [passwordHash, setasswordHash] = React.useState(``);



  const handleSubmit = (event)=>{
    event.preventDefault();
    const formData = new FormData(event.target);

    axios.post('http://localhost:4444/auth/register', formData).then((response)=>{
      setData(response.data);
      console.log(response.data);
    });
  };

  return (
    <div className={styles.content}>
      <h2>Регистрация</h2>
      <form onSubmit={handleSubmit}>
        <input
          class="text"
          type="text"
          name="lastName"
          placeholder="Фамилия"
          required=""
        />
        <input
          class="text"
          type="text"
          name="name"
          placeholder="Имя"
          required=""
        />
        <input
          class="text"
          type="text"
          name="patronymic"
          placeholder="Отчество (при наличии)"
        />
        <input
          class="text"
          type="text"
          name="email"
          placeholder="Email"
          required=""
        />
        <input
          class="text"
          type="text"
          name="localityShipping"
          placeholder="Город"
          required=""
        />
        <input
          class="text"
          type="text"
          name="addressShipping"
          placeholder="Адрес"
          required=""
        />
        <input
          class="text"
          type="text"
          name="postcode"
          placeholder="Почтовый индекс"
          required=""
        />
        <input
          class="text"
          type="text"
          name="passwordHash"
          placeholder="Пароль"
          required=""
        />
         <div className={styles.buttons}>
        <button className={styles.orangeButton} type='submit'>Создать аккаунт</button>
        <Link to='/auth/login'> <button className={styles.yellowButton}> Войти</button></Link>
      </div>
      </form>

    </div>
  );
}
export default Registration;
